const DataSet = require("@antv/data-set");







class BankPersonal extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      auth: true,

line_table_columns : [{ title: 'Order Number',dataIndex: 'oNumber', key: 'oNumber',}],
line_table_data : [{ key: '1', oNumber: 'DVO524',}],
    }
  }

  onAuthStateChange = () => {
    this.setState({auth: !this.state.auth});
  }
  render() {



  const MenuList = (props) => {
  return [
    <li>Login</li>,
    <li>Signup</li>,
  ];
};

const AuthMenuList = (props) => {
  return [
    <li>Home</li>,
    <li>About</li>,
    <li>Contact Us</li>,
    <li>Logout</li>
  ];
};


showModal = () => {
    this.setState({ modalVisible: true });
  };

  handleCancel = () => {
    this.setState({ modalVisible: false });
  };



  saveFormRef = formRef => {
    this.formRef = formRef;
  };

  showDrawer = () => {
    this.setState({
      drawerVisible: true
    });
  };

  onClose = () => {
    this.setState({
      drawerVisible: false
    });
  };

    return [
     <div>
       <button onClick={this.onAuthStateChange}>
       Auth
       </button>
     </div>,
      <ul>
        {
          this.state.auth ?
            <AuthMenuList /> : <MenuList />
        }
      </ul>
    ]
  }
}


export default BankPersonal;
